import React from "react";
import "./App.css";
import axios from "axios";

function App() {
  function test() {
    axios.get("http://localhost:3000/questions").then((res) => console.log(res));
  }

  const headers = {
    "Content-Type": "application/json",
  };

  var data = {
    question: "test2",
  };

  function handleClick(e) {
    e.preventDefault();
    axios
      .post("http://localhost:3000/questions", data, {
        headers: headers,
      })
      .then((res) => console.log(res))
      .catch(err => console.log(err));
  }

  function handleQuestion(e){
    e.preventDefault();
    axios
      .get("http://localhost:3000/questions/2")
      .then((res) => console.log(res))
      .catch(err => console.log(err));
  }

  return (
    <div className="App">
      <header className="App-header">
        {test()}
        <a href="#" onClick={handleClick}>
          Kliknij mnie
        </a>
        <a href="#" onClick={handleQuestion}>
          Kliknij mnieee
        </a>
      </header>
    </div>
  );
}

export default App;
